import React from 'react';
import { prependOnceListener } from 'cluster';

const Scroll = () => {
    return(
        <div style ={{overflow: 'scroll', border: '5px solid black', height: '800px'}}>
            {prependOnceListener.children}
        </div>
    );
};

export default Scroll;
